import React,{useEffect, useState} from 'react';
import axios from 'axios';
import DeleteQues from './DeleteQues';

function Delete()
{
    const [questionList, setQuestionList] = useState([]);
    useEffect(() => {
        console.log('Setting Question List');
        axios.get('http://localhost:8081/getQuesForDelete')
        .then((res)=>{
            console.log(res);
            setQuestionList(res.data);
        })
        .catch((err)=>console.log(err));
        console.log(questionList);
      }, []);

       

    const handleSelection = (checked, quesId) => {
        console.log(checked);
        if(checked)
        {
            setQuestionList(
                questionList.concat(quesId)
            );
        }
        
      };
    return(
    <div>
        <table className='table table-primary w-100'>
            <thead>
                <tr>
                    <th></th>
                    <th>Question No.</th>
                    <th>Question Text</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td colSpan = "3">
                    {questionList.map((element, index)=>(
                    <DeleteQues 
                    key = {index} 
                    quesId = {element.id} 
                    quesNo = {element.ques_no} 
                    quesText = {element.ques_text} 
                    handleSelection = {handleSelection}
                    />
                    ))}</td>
                </tr>
                <tr>
                    <td colSpan="2">
                        <button className='btn btn-danger vw-100'>Delete</button>
                    </td>
                </tr>
            </tbody>
        </table>
    </div>
    );
}

export default Delete;
